//import './ContentPage.css';

function Paintings() {
    return (
      <div className="Paintings">
          <p>
            In my free time, I enjoy smearing big blots of color on canvases 
            (particularly, oil painting). Here are a few of my selected works. 
            Please direct any <b>painting-related inquiries</b> to my 
            personal email myradotzel[at]gmail[dot]com.
          </p>
      </div>
    );
  }
  
  export default Paintings;
